// SPDX-License-Identifier: MIT
pragma solidity >=0.7.0 <0.9.0;

contract Callee {
    address callerAddress;
    address adminAddress = 0x5B38Da6a701c568545dCfcB03FcB875f56beddC4; 

    modifier onlyAdmin() {
        require(msg.sender == adminAddress, "Only admin can call this function");
        _; 
    }

    function callTo() public view returns (address) {
        require(msg.sender == callerAddress, "Only caller can call this function");
        return msg.sender;
    }

    function setCallerAddress(address _address) public onlyAdmin {
        callerAddress = _address;
    }
     
}

contract Caller {
    function callTo() public view returns (address) {
        return Callee(0xd9145CCE52D386f254917e481eB44e9943F39138).callTo();
    }
}

